import "./ToDo.scss";

const ToDo: React.FC = () => {
  return (
    <div>
      <div className="container pt-3 pb-3">
        <div className="mb-3">
          <label>Title: </label>
          <input
            type="text"
            placeholder="enter title"
            className="input-title" onChange={handleChange}
          />
        </div>

        <div className="mb-3">
          <label>Description: </label>
          <input
            type="text"
            placeholder="enter description"
            className="input-desc" onChange={handleCha}
          />
        </div>

        <div>
          <button className="btn btn-primary">POST</button>
        </div>
      </div>
    </div>
  );
};

export default ToDo;
